// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmControlGroup 
} from '@vime/core';

import { define } from '../lib';


define('vm-control-group', VmControlGroup);


export interface ControlGroupProps extends JSX.VmControlGroup, HTMLAttributes<HTMLVmControlGroupElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmControlGroupElement, ControlGroupProps>(
  'vm-control-group',
  new Set(['space']),
);
